// Colours and seg 7 array
char seg7[] = {0x3F, 0x06, 0x5B, 0x4F, 0x66, 0x6D, 0x7D, 0x07, 0x7F, 0x6F};
short int colour[10] = {0xAE92, 0xF63D, 0xCE3E, 0xF738, 0xF698, 0xC79C, 0xC6FE, 0x6BBA, 0x7098, 0xD34D};
