void key_press();
void add_score();
void draw_special_grid_in_while();
void change_player_colour();
void change_speed();

int main(void){
	
	// Draw start game screen
    bool potentialStart = false, doneStartScreen = false;
    draw_image(startScreen);
	*hexPtr = 0;
    while(!doneStartScreen){
        int keyValue = *keyPtr;
        if(keyValue == 2)potentialStart = true;
        else if(keyValue == 0 && potentialStart == true){
            doneStartScreen = true;
			printf("Game starting...\n");
        }
    }
	
	// Game in progress 
    while(1){
		volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
		
		// Set front pixel buffer to start of FPGA On-chip memory 
		// First store the address in the back buffer
		*(pixel_ctrl_ptr + 1) = 0xC8000000; 
		
		// Now, swap the front/back buffers, to set the front buffer location
		wait_for_vsync();
		
		// Initialize a pointer to the pixel buffer, used by drawing functions
		pixel_buffer_start = *pixel_ctrl_ptr;
		
		// Clear VGA and draw background of the game
		clear_screen();
		draw_image(instruction_background);
		draw_background(); 
		
		// Pixel_buffer_start points to the pixel buffer
		// Set back pixel buffer to start of SDRAM memory
		*(pixel_ctrl_ptr + 1) = 0xC0000000;
		
		// Draw on the back buffer
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);
		clear_screen();
		draw_image(instruction_background);
		draw_background();

		// Initialize random walls including its colour 
		// and openings and direction
		for(int i = 0; i < 8; i++){
			middleOpening[i] = rand() % 8 + 1;
			wallColour[i] = colour[rand() % 10];
			dir[i] = rand() % 4;
		}

		// For 1 wall at a time
		direction = dir[rand() % 8];
		opening = middleOpening[rand() % 8];
		colourWall = wallColour[rand() % 8]; 

		// Initialize speed
		speed = 1800000;
		
		// Initialize HEX display
		*hexPtr = seg7[0] | seg7[0] << 8;
		
		// If the player did not die, game continues
		while (!dead){ 

		    // Clean up wall in both front and back pixels
			if(counter != 0){
				if(prevOccupiedCol != -1)clearVerticalWall(prevOccupiedCol);
				if(prevOccupiedRow != -1)clearHorizontalWall(prevOccupiedRow);
				prevOccupiedCol = occupiedCol;
				prevOccupiedRow = occupiedRow;   
			}
			counter = 1;
			
			// Change speed when user gets 6 points 
			change_speed();
			
			// Change player colour every 6 points
			change_player_colour();
			
			// Special grid is being drawn every 3 points
			draw_special_grid_in_while();
		
			// Adjust speed
			speed_adjust(speed);  
			
			// Check if any key is being pressed
			key_press();
			
			// Add score on segment 7 display
			add_score();
			
			// Swap front and back buffers on VGA vertical sync
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr + 1); // New back buffer
		}
		
		//Display died on hex
		volatile int * HEX3_HEX0_ptr = (int *) 0xFF200020;
		int HEX_bits;
		HEX_bits = 0X5E06795E;
		*HEX3_HEX0_ptr = HEX_bits;
        volatile int * HEX5_HEX3_ptr = (int *) 0xFF200030;
        HEX_bits = 0X00003E00;
        *HEX5_HEX3_ptr = HEX_bits;
		printf("Your total score is: %d\n", score);
        //for poll I/O on keys
		bool potentialRestart = false;
		
		// Reset everything when user dies
		while(dead){
			keyValue = *keyPtr;
			if(keyValue == 1)potentialRestart = true;
			else if(keyValue == 0 && potentialRestart == true){
				printf("Restarting...\n");
				dead = false;
				playerX = 4;
				playerY = 4;
				counter = 0;
				*HEX3_HEX0_ptr = 0;
                *HEX5_HEX3_ptr = 0;
				score = 0;
				topWall = 0;
				bottomWall = 9;
				occupiedCol = 0;
				occupiedRow = 0;
				break;
			}
		}
    } 
}

void change_speed() {
	if(score != 0) {
		if(score % 6 == 0 && first_time) {
			speed = speed / speed_factor;
			first_time = false;
		} else if(score % 6 != 0) {
			first_time = true;
		}
	} else {
		first_time = true;
	}
}

void change_player_colour() {
	if(score != 0) {
		if(score % 6 == 0 && change_colour) {
			playerColour = colour[rand() % 10];
			change_colour = false;
		} else if(score % 6 != 0) {
			change_colour = true;
		}
	} else {
		change_colour = true;
	}
}

void draw_special_grid_in_while() {
	if(score != 0) {
		if(score % 3 == 0 && draw_special) {
			special_colour = colour[rand() % 10];
			special_x = rand() % 5 + 3;
			special_y = rand() % 5 + 3;
			draw_special = false;
			draw_grid_special = true;
		} else if(score % 3 != 0) {
			draw_special = true;
			draw_grid_special = false;
		}
	} else {
		draw_special = true;
		draw_grid_special = false;
	}
	
	if(draw_grid_special) {
		prevSpecialX = special_x;
		prevSpecialY = special_y;
		draw_special_grid(special_x, special_y, special_colour);
	} else {
		special_x = -1;
		special_y = -1;
		draw_grid(prevSpecialX, prevSpecialY, white);
	}
}

void add_score() {
	if(addScore) {
		score++;
		printf("Your current score: %d\n", score);
		int single_digit = score % 10;
		int tenth_digit = score / 10;
		*hexPtr = seg7[single_digit] | seg7[tenth_digit] << 8;
		addScore = false;
	}
}

void key_press() {
	// For clearing double buffer for the user
	if(movePlayerSignal) {
		draw_player(prevPlayerX, prevPlayerY, white, false);
		movePlayerSignal = false;
		draw_player(playerX, playerY, playerColour, true);
	} else {
		draw_player(playerX, playerY, playerColour, true);
	}
	
	// Obtain key value to check if the user press keys or not
	keyValue = *keyPtr;
	if(keyValue != 0)once = false;
	
	// If the user press KEY0, the user moves to the right
	if(keyValue == 1) {
		prevPlayerX = playerX;
		prevPlayerY = playerY;
		playerX += 1;
		if(playerX == 10) {
			playerX = 9;
		}
	//If user press KEY1, the user moves to the left
	} else if(keyValue == 2) {
		prevPlayerX = playerX;
		prevPlayerY = playerY;
		playerX -= 1;
		if(playerX == -1) {
			playerX = 0;
		}
	//If user press KEY2, the user moves down
	} else if(keyValue == 4) {
		prevPlayerX = playerX;
		prevPlayerY = playerY;
		playerY += 1;
		if(playerY == 10) {
			playerY = 9;
		}
	//If user press KEY3, the user moves up
	} else if(keyValue == 8) {
		prevPlayerX = playerX;
		prevPlayerY = playerY;
		playerY -= 1;
		if(playerY == -1) {
			playerY = 0;
		}
	}	
	
	// Draw player when the key is pressed
	if(keyValue != 0){
		draw_player(prevPlayerX, prevPlayerY, white, false);
		draw_player(playerX, playerY, playerColour, true);
		movePlayerSignal = true;
	}
}

//Draw player on the game board, only one grid
void draw_player(int a, int b, short int gridColour, bool playerGrid){
	
	// If player on special grid, need to change the grid colour
	// and player colour according to the special grid colour
	if(a == special_x && b == special_y) {
		gridColour = special_grid[a][b];
		draw_grid_special = false;
		playerColour = gridColour;	
	}
	
    //only draw player if not dead
    if(!dead){
        int xMin = a*sideLength;
        int yMin = b*sideLength;
        int xMax = ((a+1)*sideLength)-1;
        int yMax = ((b+1)*sideLength)-1;
        int x, y;
        
        for(x = xMin; x < xMax; x++){
            for(y = yMin; y < yMax; y++){
                if(x % 24 == 0 || x % 24 == 23 || y % 24 == 0 || y % 24 == 23){
                    // Draw black
                    plot_pixel(x, y, backgroundColour);
                }else{
                    // Draw player colour
                    if(playerGrid) plot_pixel(x,y,gridColour);
                    else {
                        // If on wall and will move to another position, colour with wall colour, not white
                        if(gridColour == white  && !once){
                            // Still need to check if in opening
                            if(a == occupiedCol && (b > opening + 1 || b < opening - 1)) {
                                plot_pixel(x,y,colourWall);
                            } else if ( b == occupiedRow && (a > opening + 1 || a < opening - 1)) {
                                plot_pixel(x,y,colourWall);
                            } else {
                                plot_pixel(x,y,gridColour);
                            }
                            once = true;
                        } else if(enteredDrawPlayer && once){
                            if(a == occupiedCol && (b > opening + 1 || b < opening - 1)) {
                                plot_pixel(x,y,colourWall);
                            } else if (b == occupiedRow && (a > opening + 1 || a < opening - 1)) {
                                plot_pixel(x,y,colourWall);
                            } else {
                                plot_pixel(x,y,gridColour);
                            }
                            once = false;
                        }else plot_pixel(x,y,gridColour);
                    }  
                }
            }
        }
		
		// Condition to check if the user bumps into a wall
        if(grid[a][b] != white && grid[a][b] != gridColour){
            // If drawing player
            if(playerGrid){
                // Check if going towards each other(wall and player)
                if(gameOverNext){
                    * ledPtr = 1;
                    draw_image(endGame_map);
                }
                if(!gameOverNext && !towardsEachOther(a,b)){
                    * ledPtr = 1;
                    draw_image(endGame_map);
                }
                if(towardsEachOther(a,b))gameOverNext = true;
                
            // If clearing player
            }else{
                *ledPtr = 0;
            }
        }else{
            *ledPtr = 0;
        }
    }
    enteredDrawPlayer = true;
	
	// If wall has finished displaying on the screen 
	// and the user is not dead, add 1 to scoe
	if(finishedWall && !dead) {
		addScore = true;
	}
}

//for checking if the player and walls are going towards each other: make sure they 
//overlap on the screen fist before the game terminates
bool towardsEachOther(int playerA, int playerB){
    switch(direction){
        case 0: // Wall from top
            if(occupiedRow <= playerB && *keyPtr == 8)return true;
        case 1: // Wall from bottom
            if(occupiedRow >= playerB && *keyPtr == 4)return true;
        case 2: // Wall from left
            if(occupiedCol <=  playerA && *keyPtr == 2)return true;
        case 3: // Wall from right
            if(occupiedCol >=  playerA && *keyPtr == 1)return true;
    }
}

void speed_adjust(int startValue){
    int count = startValue;
    while(count > 0){
        count--;
    }
    randomBars();
}

void randomBars(){
    if(direction == 0) { // From top
		finishedWall = false;
        wallUpDown(topWall, opening, colourWall);
        topWall += 1;
    } else if(direction == 1) { // From bottom
		finishedWall = false;
        wallUpDown(bottomWall, opening, colourWall);
        bottomWall -= 1;
    } else if(direction == 2) { // From left
		finishedWall = false;
        wallLeftRight(topWall, opening, colourWall);
        topWall += 1;
    } else if(direction == 3) { // From right
		finishedWall = false;
        wallLeftRight(bottomWall, opening, colourWall);
        bottomWall -= 1;
    }
    
	// If the wall is going out of bounds, reset its direction
	// colour and openings
    if(topWall == 10) {
		finishedWall = true;
        topWall = 0;
        direction = dir[rand() % 8];
        opening = middleOpening[rand() % 8];
        colourWall = wallColour[rand() % 8];
    }else if(bottomWall == -1) {
		finishedWall = true;
        bottomWall = 9;
        direction = dir[rand() % 8];
        opening = middleOpening[rand() % 8];
        colourWall = wallColour[rand() % 8];
    }
}

void clear_screen(){
    for(int j = 0; j < 240; j++){
        for(int i = 0; i < 320; i++){
            plot_pixel(i, j, backgroundColour);
        }
    }
}

void wait_for_vsync(){
    volatile int * pixel_ctrl_ptr = (int *) 0xFF203020; // Beginning addr of DMA controller
    register int status;
    *pixel_ctrl_ptr = 1; // Request to synchronize with VGA timing: sets S = 1 in status register
    status = *(pixel_ctrl_ptr + 3); // Get S
    while((status & 0x1)!=0){ // Check is S = 1?
        status = *(pixel_ctrl_ptr + 3); // If S = 1, update status variable and keep checking
    } // Exit while loop when S = 0(which is when DMA controller finsihed transfering pixels)
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

// Subroutine for drawing walls, drawing one grid at a time
void draw_grid(int a, int b, short int gridColour){
	grid[a][b] = gridColour;
	
    //i, j is which index of grid to draw
    int xMin = a*sideLength;
    int yMin = b*sideLength;
    int xMax = ((a + 1) * sideLength) - 1;
    int yMax = ((b + 1) * sideLength) - 1;
    int x, y;
    
	for(x = xMin; x < xMax; x++){
    	for(y = yMin; y < yMax; y++){
            if(x % 24 == 0 || x % 24 == 23 || y % 24 == 0 || y % 24 == 23){
                // Draw black
                plot_pixel(x, y, backgroundColour);
            }else{
                // Draw colour
                plot_pixel(x,y,gridColour);
            }
        }
    }
}

// Draw special grid on the gmae
void draw_special_grid(int a, int b, short int special_grid_colour) {
	special_grid[a][b] = special_grid_colour;
	int xMin = a*sideLength;
    int yMin = b*sideLength;
    int xMax = ((a+1)*sideLength)-1;
    int yMax = ((b+1)*sideLength)-1;
    int x, y;
	
	// Drawing a plus sign to indicate this is a special grid
	for(x = xMin; x < xMax; x++) {
		for(y = yMin; y < yMax; y++) {
			if(x % 24 == 0 || x % 24 == 23 || y % 24 == 0 || y % 24 == 23) {
				plot_pixel(x, y, backgroundColour);
			} else if((x >= xMin + 9 && x <= xMin + 14)|| (y >= yMin + 9 && y <= yMin + 14)) {
				plot_pixel(x, y, backgroundColour);
			} else {
				plot_pixel(x, y, special_grid_colour);
			}
		}
	}
}

//for initial white grid background
void draw_background(){
    for(int i = 0; i < 10; i++){
        for(int j = 0; j < 10; j++){
            draw_grid(i, j, white);
        }
    }
}

// Vertical wall
void wallLeftRight(int colToColour, int middleOpening, short int wallColour){
    occupiedCol = colToColour;
    // Opening is from middleOpening - 1 to middleOpening + 1
    for(int row = 0; row < 10; row ++){
        if(row!=middleOpening && row!=middleOpening+1 && row!=middleOpening-1){
            draw_grid(colToColour, row, wallColour);
        }
    }
}

//Horizontal wall
void wallUpDown(int rowToColour, int middleOpening, short int wallColour){
    occupiedRow = rowToColour;
	// Opening is from middleOpening - 1 to middleOpening + 1
    for(int col = 0; col < 10; col++){
        if(col!=middleOpening && col!=middleOpening+1 && col!=middleOpening-1){
            draw_grid(col, rowToColour, wallColour);
        }
    }   
}

void clearVerticalWall(int col){
    for(int i = 0; i < 10; i++){
        draw_grid(col, i, white);
    }
}

void clearHorizontalWall(int row){
    for(int i = 0; i < 10; i++){
        draw_grid(i, row, white);
    }
}

//for using image arrays
void draw_image(unsigned int imageArr[]) {
    clear_screen();
    int i = 0, j = 0;
    for (int k = 0; k < 320 * 2 * 240 - 1; k += 2) {
        int red = ((imageArr[k + 1] & 0xF8) >> 3) << 11;
        int green = (((imageArr[k] & 0xE0) >> 5)) | ((imageArr[k + 1] & 0x7) << 3);
        int blue = (imageArr[k] & 0x1f);
        short int p = red | ((green << 5) | blue);
        plot_pixel(0 + i, j, p);
        i += 1;
        if (i == 320) {
            i = 0;
            j += 1;
        }
    }
    if(imageArr == endGame_map)dead = true;
}

